import { Link, Route, Routes } from 'react-router-dom';
import './App.css';
import Home from './pages/Home';
import About from './pages/About';
import NotFound from './pages/NotFound';
import Book from './pages/Book';
import Data from './pages/data';
import PlayersList from './components/PlayersList';
import Guy from './pages/guy';
import Test from './pages/test';
import BookList from './pages/BookList';
import Newbook from './pages/Newbook';
import Jdid from './Jdid';
import Jdid1 from './pages/Jdid1';

import Jdid3 from './pages/Jdid3';
import Jdid2 from './pages/Jdid2.JS';



function App() {
  return (<> 
  <nav className='nav'>
    <ul>
      <li><Link to='/'>Home</Link></li>
      <li><Link to='about'>About</Link></li>
      <li><Link to='resposive'>Responsive</Link></li>
      <li><Link to='player'>FIFA Cards</Link></li>
      <li><Link to='malahala'>BUTTON</Link></li>

    </ul>
  </nav>
  <Routes>
    <Route path='resposive' element={<Data/>}/>
    <Route path='test' element={<Guy/>}/>
      <Route path='/' element={<Home/>}/>
      <Route path='player' element={<PlayersList/>}/>
      <Route path='about' element={<About/>}/>
      <Route path='about/book' element={<Book/>}/>
      <Route path='*' element={<NotFound/>}/>
      <Route path='malahala' element={<Test/>}/>
      <Route path='malahala/:id' element={<BookList/>}/>
      <Route path='malahala/new' element={<Newbook/>}/>
      <Route path='malahala/ljdid/jdid1/jdid2/jdid3' element={<Jdid/>}/>
      <Route path='malahala/ljdid/jdid1/jdid2/jdid3' element={<Jdid1/>}/>
      <Route path='malahala/ljdid/jdid1/jdid2/jdid3' element={<Jdid2/>}/>
      <Route path='malahala/ljdid/jdid1/jdid2/jdid3' element={<Jdid3/>}/>
    </Routes>
    </>

  );
}

export default App;
